      my $class = shift;
      my $number = shift;
      $number =~ s/(^\+61|\D)//g;
      my $self = bless({ country_code => '61', number => $number, formatters => $formatters, validators => $validators, timezones => $timezones, areanames => \%areanames}, $class);
      return $self if ($self->is_valid());
      my $prefix = qr/^(?:([59]\d{7})$|0)/;
      my @matches = $number =~ /$prefix/;
      if (defined $matches[-1]) {
        no warnings 'uninitialized';
        $number =~ s/$prefix/8$1/;
      }
      else {
        $number =~ s/$prefix//;
      }
      $self = bless({ country_code => '61', number => $number, formatters => $formatters, validators => $validators, areanames => \%areanames}, $class);
